create table geo_city(    id            bigint auto_increment comment '主键id'        primary key,    is_del        tinyint  default 0                 not null comment '是否逻辑删除:0.否 1.是',    created_date  datetime default CURRENT_TIMESTAMP not null comment '创建时间',    created_by    varchar(32)                        not null comment '创建者code',    created_name  varchar(32)                        not null comment '创建者名称',    updated_date  datetime default CURRENT_TIMESTAMP not null comment '更新时间',    updated_by    varchar(32)                        not null comment '更新者code',    updated_name  varchar(32)                        not null comment '更新者名称',    province_code varchar(32)                        not null comment '省adCode',    city_name     varchar(32)                        not null comment '市名称',    city_code     varchar(32)                        not null comment '市adCode',    constraint city_uk        unique (province_code, city_code))    comment '市表' charset = utf8mb4;INSERT INTO geo_city (id, is_del, created_date, created_by, created_name, updated_date, updated_by, updated_name, province_code, city_name, city_code) VALUES (1, 0, '2020-12-02 11:01:48', 'admin', '管理员', '2020-12-02 11:01:48', 'admin', '管理员', '110000', '北京市', '110100');INSERT INTO geo_city (id, is_del, created_date, created_by, created_name, updated_date, updated_by, updated_name, province_code, city_name, city_code) VALUES (2, 0, '2020-12-02 11:01:48', 'admin', '管理员', '2020-12-02 11:01:48', 'admin', '管理员', '120000', '天津市', '120100');INSERT INTO geo_city (id, is_del, created_date, created_by, created_name, updated_date, updated_by, updated_name, province_code, city_name, city_code) VALUES (3, 0, '2020-12-02 11:01:48', 'admin', '管理员', '2020-12-02 11:01:48', 'admin', '管理员', '130000', '石家庄市', '130100');INSERT INTO geo_city (id, is_del, created_date, created_by, created_name, updated_date, updated_by, updated_name, province_code, city_name, city_code) VALUES (4, 0, '2020-12